      {
        title: "Perjanjian - Perjanjian Pada Umumnya",
        subtitle:
          "Yaitu menyangkut pembuatan dan pemeriksaan segala bentuk perjanjian yang menyangkut aktivitas perusahaan dibidang perdagangan dan industry",
        icon: "",
